import React from 'react'
import { useHistory } from 'react-router-dom'
import auth from '../SignIn/auth'

export default function Devices() {
    let history = useHistory
    const logout = () => {
        auth.logout()
    }
    return (
        <div>
            <h1>Protected page</h1>

            <button onClick={logout}>logout </button>
        </div>
    )
}
